import './App.css';
import {BrowserRouter as Router,Route,Routes} from 'react-router-dom';
import { Home } from './component/Home';

function App() {
  return (
    <div className="App">
      <h1>React Router Dom Demo</h1>

      <Router>
        <Routes>
          <Route path='/' element={<Home/>}/>
        </Routes>
      </Router>
    </div>
  );
}

export default App;
